import Navbar from '../../components/navbar';
import Footer from '../../components'
export default function home(props) {
  return (
    <div>
      <Navbar/>
      <h1 style={{textAlign:"center"}}>{props.Children}</h1>
      <Footer details1="hello" details2="hello" details3="hello"/> 
    </div>
  )
}
